import React from 'react';
import { Button, Card, Flex, Typography } from 'antd';

const cardStyle = {
  maxWidth: 1034,
  width: '100%',
  margin: '0 auto',
  padding: 0,
};

const imgStyle = {
  display: 'block',
  width: 410,
  height: 525,
};

const DetailBox = () => (
  <Card style={cardStyle} bodyStyle={{ padding: 0 }}>
    <Flex justify="space-between">
      <img
        alt="avatar"
        src="/media/gunssak.png"
        style={imgStyle}
      />
      <Flex
        vertical
        align="flex-end"
        justify="space-between"
        style={{}}
      >
        <Typography.Title level={3}>군싹</Typography.Title>
        <Button type="primary" href="https://ant.design" target="_blank">
          Get Started
        </Button>
      </Flex>
    </Flex>
  </Card>
);

export default DetailBox;
